import React from 'react';
import { Box, MenuItem, Typography, Select, Button, FormControl } from '@material-ui/core';
import { FormikHelpers, Formik, Form, Field, FieldProps } from 'formik';
import { ModelOTP } from './model';


const OTP = () => {
    return (
        <Box>
            <Box textAlign="left" padding="20px">
                <Typography variant="h4" component="h4" >DayOne</Typography>
            </Box>
            <Box>
                <Typography variant="h4" component="h4" >Let's get started!</Typography>
            </Box>
            <Box>
                <Formik
                    initialValues={{
                        country: '',
                        phone: ''
                    }}
                    onSubmit={(
                        values: ModelOTP,
                        { setSubmitting }: FormikHelpers<ModelOTP>
                    ) => {
                        setTimeout(() => {
                            console.log(values, 'value----')
                            setSubmitting(false);
                        }, 500);
                    }}
                >
                    {({ submitForm }) => (
                        <Form>
                            <Box display="flex" justifyContent="center" alignItems="center" padding="20px" width="60%">
                                <Field
                                    name='country'
                                >
                                    {({
                                        field
                                    }: FieldProps<ModelOTP>) => (

                                        <Select
                                            value={field.value || ''}
                                            onChange={field.onChange}
                                            name={field.name}
                                        >
                                            <MenuItem value={10}>Ten</MenuItem>
                                            <MenuItem value={20}>Twenty</MenuItem>
                                            <MenuItem value={30}>Thirty</MenuItem>
                                        </Select>

                                    )}
                                </Field>
                            </Box>

                            <Button
                                variant="contained"
                                color="primary"
                                onClick={submitForm}
                            >
                                Submit
                            </Button>
                        </Form>
                    )}
                </Formik>
            </Box>

        </Box >
    )
}

export default OTP;
